import { JSX } from 'react'

export interface PostProps {
    auther: string,
    title: string,
    content: string,
    createdAt: string
}

export default function Post({ auther, title, content, createdAt }: PostProps): JSX.Element {
    return (
        <>
            <div className='my-3 container w-50 mx-auto border border-gray-300 rounded-md shadow-md p-4'>
                <div><img src="" alt="" /> <h2 className='text-lg font-blod'></h2></div>


                <p className='text-gray-500 text-sm'>{createdAt}</p>
                <h5 className="text-xl font-semibold mt-2">{title}</h5>
                <p className="text-gray-700 mt-1">{content}</p>
            </div>
        </>
    )
}
